script: |
  super -f text -I q1351.spq | sort > q1351.out

inputs:
  - name: q1351.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE ( + ( + col2 ) ) NOT BETWEEN ( + 31 / col0 + + 39 * - 89 ) AND 59;
  - name: tab1

outputs:
  - name: q1351.out
    data: |
      51	14	96
      91	47	68
